  width: 0;
  height: 0;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  right: 0px;
  transition: 0.2s;
}

.fade-enter {
  opacity: 0;
}

.fade-enter-active {
  opacity: 1;
  transition: opacity 200ms;
}

.fade-exit {
  opacity: 1;
}

.fade-exit-active {
  opacity: 0;
  transition: opacity 200ms;
}

.zoom-enter {
  opacity: 0;
  transform: scale(0.8);
  transform-origin: top left;
}

.zoom-enter-active {
  opacity: 1;
  transform: scale(1);
  transition: opacity 200ms, transform 200ms;
  transform-origin: top left;
}

.zoom-exit {
  opacity: 1;
  transform: scale(1);
  transform-origin: top left;
}

.zoom-exit-active {
  opacity: 0;
  transform: scale(0.8);
  transition: opacity 200ms, transform 200ms;
  transform-origin: top left;
}

.toTopLeft-enter {
  opacity: 0;
  transform: translate(10px, 10px);
}

.toTopLeft-enter-active {
  opacity: 1;
  transform: translate(0px, 0px);
  transition: opacity 200ms, transform 200ms;
}

.toTopLeft-exit {
  opacity: 1;
  transform: translate(0px, 0px);
}

.toTopLeft-exit-active {
  opacity: 0;
  transform: translate(10px, 10px);
  transition: opacity 200ms, transform 200ms;
}

.rightToLeft-enter {
  opacity: 0;
  transform: translateX(10px);
}

.rightToLeft-enter-active {
  opacity: 1;
  transform: translateX(0px);
  transition: opacity 200ms, transform 200ms;
}

.rightToLeft-exit {
  opacity: 1;
  transform: translateX(0px);
}

.rightToLeft-exit-active {
  opacity: 0;
  transform: translateX(10px);
  transition: opacity 200ms, transform 200ms;
}

.pop-enter {
  opacity: 0;
  transform: scale(0.8);
}

.pop-enter-active {
  opacity: 1;
  transform: scale(1);
  transition: opacity 200ms, transform 200ms;
}

.pop-exit {
  opacity: 1;
  transform: scale(1);
}

.pop-exit-active {
  opacity: 0;
  transform: scale(0.8);
  transition: opacity 200ms, transform 200ms;
